import { Component } from "react";
const styles = {
    footer: {
        height: '600px',
        backgroundImage: 'linear-gradient(to bottom, #2f303a66, #2f303a66), url(/img/footer.png)',
        backgroundSize: 'cover', // Ajustar tamaño de la imagen de fondo para cubrir completamente el contenedor
        backgroundPosition: 'center bottom', // Alinear la imagen de fondo en el centro y en la parte inferior
        position: 'relative', // Añadir posición relativa para posicionar el contenido encima de la imagen de fondo
    }
}

class Footer extends Component{
    render() {
        return (
            <section style={styles.footer}>
                {/* Aquí puedes colocar tu contenido adicional en la parte superior */}
                <div style={{ position: 'absolute', top: '20px', left: '50%', transform: 'translateX(-50%)' }}>
                    {/* Contenido adicional */}
                </div>
            </section>
        )
    }
}
export default Footer;
